import './styles/App.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Landing from './pages/Landing';

function App() {
  return (
    <BrowserRouter>      
    <h1>test</h1>
      <Switch>
          <Route path="/" exact component={Landing}/>
      </Switch>
  </BrowserRouter>
  );
}

export default App;
